/* ==UserStyle==
@name			Modem TIM
@author			Domenico Blanco
@version		1.0.3
@namespace		https://github.com/domenicoblanco/Safari-mobile-dark-mode
@preprocessor	default
==/UserStyle== */

@-moz-document domain("192.168.1.1")
{
	:root {
		color-scheme: dark;
		--primary-color: #18191a;
		--secondary-color: #242526;
		--third-color: #0f1011;
		--text-opacity: rgba(0, 128, 128, 0.7);
	}
	
	/* Background */
	
	body, #srp_username, #srp_password, .modal-body, .modal-action-advanced, .modal-action-refresh, .open-modal, .open-modal, .open-modal:active, .open-modal:focus, .open-modal:hover, .nav-tabs>.active>a, .nav-tabs>.active>a:hover, .nav-tabs>.active>a:focus, .btn-primary, #logged .btn, #webui_language, #cancel-config, #process, li>a.btn-table-new-list:hover, li>a.btn-table-new-list:focus, .btn.disabled, .android-ics.light .dw, #signout:hover, #changepass:hover {
		background: var(--primary-color)!important;
	}
	
	.logo-technicolor, .header, .modal-header, .modal, .modal-footer, input[type="text"], input[type="password"], .nav>li>a:focus, .nav>li>a:hover, .btn-table-new, .btn, #login, .smallcard .content, .noUi-base, .smallcard .header .settings, .smallcard .header .settings:hover:hover, .smallcard .header .settings:hover:focus, .smallcard .header .settings:hover:active, .smallcard .header .settings:hover.active, .smallcard .header .settings:hover.disabled, .smallcard .header .settings:hover[disabled], .smallcard .header .settings, .dropdown-menu, .custom-handler, .switchOn, .switch, .dropdown-menu::after, .btn:hover:hover, .btn:hover:focus, .btn:hover:active, .btn:hover.active, .btn:hover.disabled, .btn:hover[disabled], select.span3, td, .btn-mini, select.span2, .dropdown-toggle:focus, .btn-group.open .btn.dropdown-toggle {
		background: var(--secondary-color);
	}
	
	.smallcard .header, .table-striped tbody>tr:nth-child(odd)>td {
		background: var(--third-color);
	}
	
	.switcher, .noUi-handle, .dropdown-menu .divider {
		background: teal;
	}
	
	#starttime, #stoptime {
		background: var(--secondary-color)!important;
	}
	
	.smallcard .header .settings, .smallcard .header .settings:hover:hover, .smallcard .header .settings:hover:focus, .smallcard .header .settings:hover:active, .smallcard .header .settings:hover.active, .smallcard .header .settings:hover.disabled, .smallcard .header .settings:hover[disabled], .settings {
		background-image: none!important;
		background-color: none!important;
	}
	
	/* Border */
	
	.custom-handler, .noUi-handle, .noUi-base, #cancel-config, .btn-primary, .nav-tabs>.active>a, .nav-tabs>.active>a:hover, .nav-tabs>.active>a:focus, .nav-tabs, .span3, .table-striped tbody>tr:nth-child(odd)>td, .dropdown-menu .divider, #logged .btn, #webui_language, #cancel-config, #process, td, .btn-mini, .smallcard, .smallcard .header .settings, .smallcard .header .settings:hover:hover, .smallcard .header .settings:hover:focus, .smallcard .header .settings:hover:active, .smallcard .header .settings:hover.active, .smallcard .header .settings:hover.disabled, .smallcard .header .settings:hover[disabled], .modal-footer {
		border: none!important;
	}
	
	legend, .noUi-target, input[type="text"], input[type="password"], .btn-table-new, .btn {
		border-bottom: 1px solid teal;
	}
	
	.header, .modal-header {
		border-bottom: 0px;
		border-radius: 3px;
	}
	
	#srp_username, #srp_password, .nav-tabs>.active>a:hover, .nav-tabs>.active>a:focus, .nav-tabs>li>a:hover, .nav-tabs>li>a:focus, #login, .btn-table-new, .btn, input[type="text"], select.span2, .noUiSlider, input[type="password"] {
		border-color: teal;
	}
	
	.copyright, #login, .smallcard .header {
		border-color: var(--secondary-color);
	}
	
	#login {
		border-radius: 10px;
	}
	
	.smallcard .header {
		border: 5px;
	}
	
	.caret {
		border-top: 4px solid var(--text-opacity);
	}
	
	.dropdown-toggle:hover .caret {
		border-top: 4px solid var(--secondary-color);
	}
	
	#logged > .btn .caret {
		border-top: 4px solid var(--text-opacity);	
	}
	
	.android-ics.light .dwb-s .dwb, .android-ics.light .dwb-n .dwb {
		border-right: 1px solid teal;
	}
	
	.android-ics.light .dwbc {
		border-top: 1px solid teal;
	}
	
	.android-ics.light .dw-bubble-bottom .dw-arrÂ {
		border-color: transparent transparent teal transparent;
	}
	
	.android-ics.light .dw-bubble-top .dw-arr {
		border-color: teal transparent transparent transparent;
	}
	
	/* Text color */
	
	#Line_Rate_Up, #Line_Rate_Down, .gray, .smallcard .subinfos, #changepass, #signout, a.btn-primary, #sign-me-in, button.btn, #webui_language, .span4, .modal-action-advanced, .modal-action i, .modal-action-refresh, #cancel-config, .btn-primary, #process, .open-modal, .open-modal:active, .open-modal:focus, .open-modal:hover, .nav-tabs>.active>a, .nav-tabs>.active>a:hover, .nav-tabs>.active>a:focus, #srp_username, #srp_password, .btn, .modal-body, legend, #close-config, button.btn, .switcher::after, .switcher::before, #logged .btn, input[type="text"], a, .nav>li>a:focus, .nav>li>a:hover, .span3, .nav-header, input[type="password"], .copyright, .smallcard .header, .dropdown-menu, .custom-handler, .switchOn, .switch, .dropdown-menu::after, .dropdown-toggle, .switcher, .noUi-handle, #login, select.span2, li>a.btn-table-new-list, li>a.btn-table-new-list:focus, li>a.btn-table-new-list:hover, .btn.disabled, font, .dw-i, .android-ics.light .dwb {
		color: teal;
	}
	
	#srp_username::placeholder, #srp_password::placeholder, .btn:focus, .btn:hover, .smallcard .content, .noUi-base {
		color: var(--text-opacity);
	}
	
	.noUi-handle, #cancel-config, .btn-primary, .btn-table-new, .btn, .nav-list>li>a, .nav-list .nav-header, .btn:hover, .smallcard .header, .modal-footer, .custom-handler, .header, .modal-header, .copyright, .switcher::after, .smallcard .header .settings, .smallcard .header .settings:hover:hover, .smallcard .header .settings:hover:focus, .smallcard .header .settings:hover:active, .smallcard .header .settings:hover.active, .smallcard .header .settings:hover.disabled, .smallcard .header .settings:hover[disabled], .btn-group>.btn+.dropdown-toggle {
		text-shadow: none;
		-webkit-box-shadow: none;
		-moz-box-shadow: none;
		box-shadow: none;
	}
	
	/* Custom components */
	
	.smallcard {
		background: none;
		border-radius: 3px;
	}
	
	select {
		-moz-appearance: none; 
		-webkit-appearance: none; 
		appearance: none;
	}
	
	/* Active button */
	
	.nav-list>.active>a, .nav-list>.active>a:hover, .nav-list>.active>a:focus, .btn:hover:hover, .btn:hover:focus, .btn:hover:active, .btn:hover.active, .btn:hover.disabled, .btn:hover[disabled] {
		background: teal;
		color: var(--secondary-color);
	}
}
